import React from 'react';
import Header from './globales/Header';
import Footer from './globales/Footer';
import './../App.css';

const Inicio = ({children}) => {
  return (
    <div className='margen0'>
      <header>
          <Header/>
      </header>
      <main>
          {children}
      </main>
      <footer>
          <Footer/>
      </footer>
    </div>
  )
}

export default Inicio
